def solve():
    s = "t53 t25 t31 t94 t54 t56 t20 t4 t80 t22 t94 t94 t54 t56 t74 t4 t36 t87 t18 t94 t96 t56 t79 t55 t37 t56"

    def is_valid(grammar, input_string):
        try:
            tree = parse_grammar(grammar, input_string)
            return tree is not None
        except:
            return False

    def parse_grammar(grammar, input_string):
        """Parses the given grammar and returns a tree."""

        def parse(symbol, index, current_string):
            if index == len(current_string):
                return True

            if symbol in grammar:
                if parse(symbol, index + 1, current_string + grammar[symbol]):
                    return True
                return False

            for production in grammar:
                if production in current_string:
                    if parse(production, index + 1, current_string + production):
                        return True
            return False

        return parse(s, 0, "")

    if is_valid(s, input_string):
        print("Yes")
    else:
        print("No")

solve()
